var e=[{id:1,title:"New publication on BEXIS2 as a FAIR-aligned research data management system",author:"Max Mustermann",date:"2012/12/20",content:'<p>Can BEXIS2 support you in making your research data compatible with Findable, Accessible, Interoperable and Reusable (FAIR) data principles?</p><p>The new publication BEXIS2: A FAIR-aligned data management system for biodiversity, ecology and environmental data by Chamanara et al. demonstrates how are the FAIR data principles integrated into the BEXIS2 application.</p><p>The paper also presents community deployment examples of the BEXIS2 instances to explain its capacity to meet the data management needs of differently sized projects and serve as an organisational research data management system.</p><p>The authors of the paper are grateful to the developers who contributed to the development of the BEXIS2 over the years; the current and previous data managers and curators for providing the feedback to improve the usability of the BEXIS2 system; Th\xFCringer Universit\xE4ts und Landesbibliothek Jena for providing the Open Access Publication Fund.</p><p><b>Citation:</b></p><p>Chamanara J, Gaikwad J, Gerlach R, Algergawy A, Ostrowski A, K\xF6nig-Ries B (2021) BEXIS2: A FAIR-aligned data management system for biodiversity, ecology and environmental data. Biodiversity Data Journal 9: e72901. <a href="https://doi.org/10.3897/BDJ.9.e72901">https://doi.org/10.3897/BDJ.9.e72901</p>'},{id:2,title:"BEXIS2 Release - 2.14.5",author:"Petra M\xFCller",date:"2009/09/20",content:'<p>Before you rush off into the weekend, wait a minute. here\u2019s some great news. We have released a small but nice new patch.</p><p>Yes, BEXIS2 2.14.5 is now available.</p><p><b>Attention:</b> Changes were made in the web.config in line: 72 (see <a href="https://github.com/BEXIS2/Core/issues/803">#803</a>)</p><p>Look forward to Monday and have fun with BEXIS2 stay healthy.</p><p>BEXIS 2.14.5 is now available >>> <a href="https://github.com/BEXIS2/Core/releases/tag/2.14.5">here</a> <<<'},{id:3,title:"BEXIS2 Release - 2.14.4",author:"Sven Thiel",date:"2022/05/06",content:'<p>From the home office we send greetings and wish good health. To make the challenging time a little more bearable, we send besides the greetings also a patch for BEXIS 2 that you should not miss.</p><p>Attention! changes have been made in SMTP credentials and web.config. If an update is made, please use the new files and adapt them.</p><p>BEXIS 2.14.4 is now available on our github page: <a href="https://github.com/BEXIS2/Core/releases/tag/2.14.4">here</a>.'}];export{e as n};
